import React, { useState, useEffect } from 'react';

const Dashboard = () => {
  const [backendStatus, setBackendStatus] = useState('checking');

  useEffect(() => {
    checkBackend();
  }, []);

  const checkBackend = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/health');
      if (response.ok) {
        setBackendStatus('connected');
      } else {
        setBackendStatus('error');
      }
    } catch (error) {
      setBackendStatus('disconnected');
    }
  };

  const testEndpoints = async () => {
    const endpoints = [
      { name: 'Health', url: 'http://localhost:5001/api/health' },
      { name: 'Menu', url: 'http://localhost:5001/api/menu' },
      { name: 'Orders', url: 'http://localhost:5001/api/orders' },
      { name: 'Dashboard', url: 'http://localhost:5001/api/dashboard/stats' }
    ];

    for (const endpoint of endpoints) {
      try {
        const response = await fetch(endpoint.url);
        const data = await response.json();
        console.log(`${endpoint.name}:`, data);
        alert(`${endpoint.name}: ${response.status} - ${JSON.stringify(data)}`);
      } catch (error) {
        console.error(`${endpoint.name} error:`, error);
        alert(`${endpoint.name} ERROR: ${error.message}`);
      }
    }
  };

  return (
    <div>
      <h1>Dashboard</h1>
      
      <div className="card">
        <h2>System Status</h2>
        <div style={{ 
          padding: '1rem',
          background: backendStatus === 'connected' ? '#d4edda' : '#f8d7da',
          border: `2px solid ${backendStatus === 'connected' ? '#c3e6cb' : '#f5c6cb'}`,
          borderRadius: '8px',
          marginBottom: '1rem'
        }}>
          <strong>Backend Status:</strong> 
          <span style={{ 
            color: backendStatus === 'connected' ? '#155724' : '#721c24',
            marginLeft: '0.5rem',
            fontWeight: 'bold'
          }}>
            {backendStatus.toUpperCase()}
          </span>
        </div>

        <button 
          className="btn btn-primary"
          onClick={testEndpoints}
          style={{ marginRight: '0.5rem' }}
        >
          üîç Test All Endpoints
        </button>
        
        <button 
          className="btn btn-secondary"
          onClick={checkBackend}
        >
          üîÑ Check Status
        </button>
      </div>

      {/* Quick Stats Placeholder */}
      <div className="stats-grid">
        <div className="stat-card">
          <h3>Total Orders</h3>
          <div className="number">0</div>
          <div className="trend">Waiting for data...</div>
        </div>
        
        <div className="stat-card">
          <h3>Total Revenue</h3>
          <div className="number">Rp 0</div>
          <div className="trend">Connect backend first</div>
        </div>
        
        <div className="stat-card">
          <h3>Active Orders</h3>
          <div className="number">0</div>
          <div className="trend">System starting...</div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="card">
        <h2>Quick Actions</h2>
        <div style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap' }}>
          <a 
            href="/order" 
            target="_blank" 
            rel="noopener noreferrer"
            className="btn btn-success"
          >
            üõí Customer Order Page
          </a>
          <a 
            href="/menu" 
            className="btn btn-primary"
          >
            üçΩÔ∏è Menu Management
          </a>
          <a 
            href="/orders" 
            className="btn btn-warning"
          >
            üìã Order Management
          </a>
        </div>
      </div>

      
    </div>
  );
};

export default Dashboard;
